// import React and ReactDom libraries
import React from 'react';
import ReactDom from 'react-dom';
// create a react component
const App = () => {
    return (
        <div>
            <label>Name</label>
            <input type="text" />
        </div>
    )
};
// take react component and show on the screen
ReactDom.render(
    <App />,
    document.querySelector('#root')
);
